import React, { useState } from "react";
import { useAuth0 } from "@auth0/auth0-react";

const Login = ({ handleLogin }) => {
  
  return (
    <div>
        <button type="submit" onClick={() => handleLogin()}>Login</button>
    </div>
  );
};

export default Login;
